    [],nt"num_tags": 7,nt"name": "tinicum-national-environmental-center-complex-annual-narrative-report-calendar-year-1990",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Tinicum
    National Environmental Center outlines Refuge accomplishments during the 1990 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the management plan and research and investigations. Refuge administration is outlined;
    information about personnel, other manpower programs, volunteer programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, grasslands, fire management, and pest control. The wildlife
    section of the report discusses wildlife diversity, endangered and threatened species,
    waterfowl, marsh and water birds, shorebirds, raptors, other migratory birds, game
    mammals, other resident wildlife, fisheries resources, wildlife propagation and
    stocking, scientific collections, marking and bird banding, and environmental contamination
    evaluation. The public uses of the Refuge described in this report include outdoor
    classrooms, interpretive programs, fishing, wildlife observation, other non-wildlife
    oriented recreation, and law enforcement. The equipment and facilities section of
    the report provides information about rehabilitation, major maintenance, equipment
    utilization and replacement, and computer systems. Cooperative programs and items
    of interest are provided at the end. Photographs and refuge brochures are attached.
    Brief narratives for Supawna Meadows National Wildlife Refuge and Killcohook Coordination
    Area are included.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
